import React from 'react';

import login from './login';
import SignUp from './SignUp';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack'; 
import { useSelector, useDispatch } from 'react-redux';

import { Text } from 'react-native';
import { NavigationNativeContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { MaterialIcons } from '@expo/vector-icons';

import { TouchableOpacity } from 'react-native-gesture-handler';
import { logout } from '../store/auth';

const Stack = createNativeStackNavigator();

const StackNav = createStackNavigator();
const Tab = createBottomTabNavigator();

const tabHomeNavigation = () => {
	const { isAuthenticated } = useSelector((state) => state.auth);

	return (
		<Tab.Navigator
			tabBarOptions={{
				style: {
					paddingVertical: 3,
					backgroundColor: '#03a9f4'
				},
				inactiveTintColor: '#bbb',
				activeTintColor: '#fff',
				labelStyle: {
					fontSize: 14
				}
			}}
		>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="directions-car" size={24} color={color} />
				}}
				name="Restaurants"
				component={List}
			/>
			<Tab.Screen
				options={{
					tabBarIcon: ({ color }) => <MaterialIcons name="account-circle" size={24} color={color} />
				}}
				name="login"
				component={login}
			/>
		</Tab.Navigator>
	);
};

export default function App() {

  const { isAuthenticated } = useSelector((state) => state.auth);

  return (
    <NavigationContainer>
      <Stack.Navigator>
        <React.Fragment>
          {!isAuthenticated && <Stack.Screen name="Login" component={login} />}
        </React.Fragment>
        <React.Fragment>
          {isAuthenticated && <Stack.Screen name="SignUp" component={SignUp} />}
        </React.Fragment>
      </Stack.Navigator>
    </NavigationContainer>
  );
}







